    "store": {"changelog.html":{"url":"changelog.html","title":"getting-started - changelog","body":"\n                   \n\nChange Log\nAll notable changes to this project will be documented in this file. See standard-version for commit guidelines.\n\n1.4.2 (2020-03-05)\nBug Fixes\n\nallow latest angular versions in peer dependencies (0f07483)\n\n\n1.4.1 (2020-02-12)\nBug Fixes\n\nupdate highlight positioning when resizing textarea (6f8d633)\n\n\n1.4.0 (2018-06-20)\nFeatures\n\nadd original MouseEvent to tag events (#5) (8985b76)\n\n\n1.3.1 (2018-05-05)\nBug Fixes\n\nallow angular 6 peer dependency (4a04f5d)\n\n\n1.3.0 (2017-11-13)\nFeatures\n\nintroduce textInputValue input (7980ee1)\n\n\n1.2.2 (2017-11-09)\nBug Fixes\n\nmake long tags wrap multiple lines (8488879)\n\n\n1.2.1 (2017-11-02)\nBug Fixes\n\nadd support for angular 5 (faf48b7)\n\n\n1.2.0 (2017-10-11)\nBug Fixes\n\nhandle the component being destroyed before the initial render is complete (cb2b3c1)\n\nFeatures\n\nexpose refresh method as part of the public api (da95817)\n\n\n1.1.1 (2017-09-26)\nBug Fixes\n\nrecompute highlight element size when the window is resized (70a5ddc)\n\n\n1.1.0 (2017-09-01)\nBug Fixes\n\nallow html special characters in the textarea value (d86f155)\n\nFeatures\n\nadd tagClick, tagMouseEnter and tagMouseLeave outputs (2fb7817)\n\n\n1.0.4 (2017-08-14)\nBug Fixes\n\ntags should wrap multiple lines (f3ba5ee)\n\n\n1.0.3 (2017-08-07)\nBug Fixes\n\nie: fix styles in IE 11 and edge (21a6abd)\n\n\n1.0.2 (2017-07-22)\nBug Fixes\n\nadd spacing between tags on adjoining rows (ca65707)\ndelay copying textarea styles to give it time to render (fcf8abe)\n\n\n1.0.1 (2017-07-22)\nBug Fixes\n\nremove fixed width from textarea (89c638b)\n\n\n1.0.0 (2017-07-22)\nFeatures\n\ninitial implementation (b7f2955)\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"dependencies.html":{"url":"dependencies.html","title":"package-dependencies - dependencies","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n    \n        Peer dependencies\n    \n    \n        \n            @angular/core : >=2.0.0\n    \n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"index.html":{"url":"index.html","title":"getting-started - index","body":"\n                   \n\nangular text input highlight\n\n\n\n\n\n\n\nDemo\nhttps://mattlewis92.github.io/angular-text-input-highlight/\nTable of contents\n\nAbout\nInstallation\nDocumentation\nDevelopment\nLicense\n\nAbout\nA component that can highlight parts of text in a textarea. Useful for displaying mentions etc\nInstallation\nInstall through npm:\nnpm install --save angular-text-input-highlightInclude the stylesheet somewhere in your app:\nnode_modules/angular-text-input-highlight/text-input-highlight.cssThen include in your apps module:\nimport { NgModule } from '@angular/core';\nimport { TextInputHighlightModule } from 'angular-text-input-highlight';\n\n@NgModule({\n  imports: [\n    TextInputHighlightModule\n  ]\n})\nexport class MyModule {}Finally use in one of your apps components:\nimport { Component, ViewEncapsulation } from '@angular/core';\nimport { HighlightTag } from 'angular-text-input-highlight';\n\n@Component({\n  template: `\n    \n      \n      \n      \n      \n    \n  `,\n  styles: [\n   `\n     // by default you won't see the highlighted tags until\n     // you add a CSS class with a background color\n     .bg-blue {\n       background-color: lightblue;\n     }\n     .bg-pink {\n       background-color: lightcoral;\n     }\n   `\n  ],\n  encapsulation: ViewEncapsulation.None\n})\nclass MyComponent {\n\n  text = 'this is some text';\n\n  tags: HighlightTag[] = [{\n    indices: { start: 8, end: 12 },\n    cssClass: 'bg-blue',\n    data: { user: { id: 1 } }\n  }];\n\n}You may also find it useful to view the demo source.\nUsage without a module bundler\n\n\n    // everything is exported angularTextInputHighlight namespace\nDocumentation\nAll documentation is auto-generated from the source via compodoc and can be viewed here:\nhttps://mattlewis92.github.io/angular-text-input-highlight/docs/\nCredits\nThis component borrows heavily from the ideas of the ui-mention package.\nDevelopment\nPrepare your environment\n\nInstall Node.js and NPM\nInstall local dev dependencies: npm install while current directory is this repo\n\nDevelopment server\nRun npm start to start a development server on port 8000 with auto reload + tests.\nTesting\nRun npm test to run tests once or npm run test:watch to continually run tests.\nRelease\nnpm run releaseLicense\nMIT\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"license.html":{"url":"license.html","title":"getting-started - license","body":"\n                   \n\nThe MIT License (MIT)\nCopyright (c) 2017 Matt Lewis\nPermission is hereby granted, free of charge, to any person obtaining a copy\nof this software and associated documentation files (the \"Software\"), to deal\nin the Software without restriction, including without limitation the rights\nto use, copy, modify, merge, publish, distribute, sublicense, and/or sell\ncopies of the Software, and to permit persons to whom the Software is\nfurnished to do so, subject to the following conditions:\nThe above copyright notice and this permission notice shall be included in all\ncopies or substantial portions of the Software.\nTHE SOFTWARE IS PROVIDED \"AS IS\", WITHOUT WARRANTY OF ANY KIND, EXPRESS OR\nIMPLIED, INCLUDING BUT NOT LIMITED TO THE WARRANTIES OF MERCHANTABILITY,\nFITNESS FOR A PARTICULAR PURPOSE AND NONINFRINGEMENT. IN NO EVENT SHALL THE\nAUTHORS OR COPYRIGHT HOLDERS BE LIABLE FOR ANY CLAIM, DAMAGES OR OTHER\nLIABILITY, WHETHER IN AN ACTION OF CONTRACT, TORT OR OTHERWISE, ARISING FROM,\nOUT OF OR IN CONNECTION WITH THE SOFTWARE OR THE USE OR OTHER DEALINGS IN THE\nSOFTWARE.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules.html":{"url":"modules.html","title":"modules - modules","body":"\n                   \n\n\n\n\n    Modules\n\n\n    \n    \n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"overview.html":{"url":"overview.html","title":"overview - overview","body":"\n                   \n\n\n\n    Overview\n\n\n\n    \n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"}}
